const linkStyle = {
  marginRight: 15,
};

const Header = () => (
  <>
    <header>
      <ul>
        <li>Home</li>
        <li>About</li>
        <li>Work</li>
        <li>Contact</li>
      </ul>
    </header>
    <style jsx>{`
      header {
        background: red;
      }
    `}</style>
  </>
);

export default Header;
